import React from "react";

class Button extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render(url) {
        const { onclick, text } = this.props; 

        return (
            <div>
                <button onClick={() => onclick(url)}>{text}</button>
            </div>
        );
    }
   
}
function onclick (url) {
    window.location.assign(url);
}

Button.defaultProps = {
    text: "Войти"
};

export default Button;
